import React from 'react'
import { ReactPDF, Page, Text, View, Document, StyleSheet } from '@react-pdf/renderer'
//import dynamic from 'next/dynamic'
//const Page, Text, View, Document, StyleSheet = dynamic(() => import('@phuocng/react-pdf-viewer'), {ssr:false})
//import '@phuocng/react-pdf-viewer/cjs/react-pdf-viewer.css'


// Create styles
const styles = StyleSheet.create({
    page: {
      flexDirection: 'row',
      backgroundColor: '#E4E4E4'
    },
    section: {
      margin: 10,
      padding: 10,
      flexGrow: 1
    }
})

// Create Document Component
const MyDocument = () => (
    <Document>
      <Page size="A4" style={styles.page}>
        <View style={styles.section}>
          <Text>Section #1</Text>
        </View>
        <View style={styles.section}>
          <Text>Section #2</Text>
        </View>
      </Page>
    </Document>
)

function Resume(){
    ReactPDF.render(<MyDocument />, `/src/pdf/CV-Developer.pdf`)
    return(
        <React.Fragment>
            <PDFViewer>
                <MyDocument />
            </PDFViewer>
        </React.Fragment>
    )
}

export default Resume
